    // Get the Bayesian Network
    public static String getBayesianNetwork(String bayesianNetwork){

        switch (bayesianNetwork.toUpperCase()) {
            case "EARTHQUAKE":
                return earthquake;
            case "SACHS":
                return sachs;
            case "ALARM":
                return alarm;
            case "HEPAR2":
                return hepar2;
            case "LINK":
                return link;
            case  "TENNIS":
                return tennis;
            default:
                System.out.println("This network not supported by default");
                return bayesianNetwork;
        }

    }

